import React, { useState } from 'react';

const Hero = () => {
  const [currentSlide, setCurrentSlide] = useState(0);
  
  const slides = [
    {
      title: "Easiest and Fastest ad booking",
      subtitle: "at the Lowest Price",
      description: "Book your Newspaper display ads in any regional or National Newspaper, Instantly!",
      image: "👨‍💼📰☕", // Using emojis as placeholder for the business man with newspaper image
      buttonText: "BOOK NOW"
    },
    {
      title: "Digital Marketing Solutions",
      subtitle: "for Modern Businesses",
      description: "Reach millions of customers through our comprehensive digital marketing services!",
      image: "💻📱🌐",
      buttonText: "GET STARTED"
    },
    {
      title: "Radio & Cinema Advertising",
      subtitle: "Maximum Impact",
      description: "Advertise across India's top radio stations and cinema halls for maximum reach!",
      image: "📻🎬🎯",
      buttonText: "EXPLORE NOW"
    }
  ];

  const nextSlide = () => {
    setCurrentSlide((prev) => (prev + 1) % slides.length);
  };

  const prevSlide = () => {
    setCurrentSlide((prev) => (prev - 1 + slides.length) % slides.length);
  };

  const handleBookNow = () => {
    alert('Booking functionality would be implemented here');
  };

  return (
    <section className="hero">
      <div className="hero-content">
        <div className="hero-text">
          <h1>
            {slides[currentSlide].title}<br />
            <span className="highlight">{slides[currentSlide].subtitle}</span>
          </h1>
          <p>{slides[currentSlide].description}</p>
          <button className="hero-cta" onClick={handleBookNow}>
            {slides[currentSlide].buttonText}
          </button>
          
          {/* Slide indicators */}
          <div className="hero-indicators" style={{ marginTop: '30px' }}>
            {slides.map((_, index) => (
              <button
                key={index}
                className={`indicator ${index === currentSlide ? 'active' : ''}`}
                onClick={() => setCurrentSlide(index)}
                style={{
                  width: '12px',
                  height: '12px',
                  borderRadius: '50%',
                  border: 'none',
                  margin: '0 5px',
                  background: index === currentSlide ? '#dc3545' : 'rgba(44,62,149,0.3)',
                  cursor: 'pointer',
                  transition: 'all 0.3s ease'
                }}
              />
            ))}
          </div>
        </div>

        <div className="hero-image">
          <div style={{
            fontSize: '8rem',
            textAlign: 'center',
            background: 'rgba(255,255,255,0.9)',
            borderRadius: '15px',
            padding: '40px',
            boxShadow: '0 20px 40px rgba(0,0,0,0.1)',
            minHeight: '300px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
          }}>
            {slides[currentSlide].image}
          </div>
          
          {/* Navigation arrows */}
          <button 
            onClick={prevSlide}
            style={{
              position: 'absolute',
              left: '-20px',
              top: '50%',
              transform: 'translateY(-50%)',
              background: 'rgba(44,62,149,0.8)',
              color: 'white',
              border: 'none',
              borderRadius: '50%',
              width: '50px',
              height: '50px',
              cursor: 'pointer',
              fontSize: '1.2rem',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              transition: 'all 0.3s ease'
            }}
            onMouseOver={(e) => e.target.style.background = 'rgba(44,62,149,1)'}
            onMouseOut={(e) => e.target.style.background = 'rgba(44,62,149,0.8)'}
          >
            <i className="fas fa-chevron-left"></i>
          </button>
          
          <button 
            onClick={nextSlide}
            style={{
              position: 'absolute',
              right: '-20px',
              top: '50%',
              transform: 'translateY(-50%)',
              background: 'rgba(44,62,149,0.8)',
              color: 'white',
              border: 'none',
              borderRadius: '50%',
              width: '50px',
              height: '50px',
              cursor: 'pointer',
              fontSize: '1.2rem',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              transition: 'all 0.3s ease'
            }}
            onMouseOver={(e) => e.target.style.background = 'rgba(44,62,149,1)'}
            onMouseOut={(e) => e.target.style.background = 'rgba(44,62,149,0.8)'}
          >
            <i className="fas fa-chevron-right"></i>
          </button>
        </div>
      </div>
    </section>
  );
};

export default Hero;
